import Navbar from './Components/Navbar';
import Textform from './Components/Textform';
import Card from './Components/Card';

function App() {
  return (<>
  <Navbar title="Mysite"  />
  <div className="container mx-1">

    <Textform/>

    <div className="row">
    <div className="col-md-4"> <Card/></div>
    <div className="col-md-4"> <Card/></div>
    <div className="col-md-4"> <Card/></div>
    <div className="col-md-4"> <Card/></div>


    </div>
    </div>



  </>
  );
}

export default App;
